{'video_id': 'GSJMVFJibg4', 'channel_title': 'TEDx Talks', 'channel_id': 'UCsT0YIqwnpJCM-mx7-gSA4Q', 'video_publish_date': 1546954558.0, 'video_title': 'Building the Unimaginable | Jan-Peter Doomernik | TEDxErasmusUniversityRotterdam', 'video_description': 'What if we could fix the world through crazy hacking? Every innovative disruption seems crazy before it is adopted. What seems nuts today may benefit society tomorrow, but only if we get to work, together, in order to build the unimaginable. Imagine how shocked a CD shop-owner from the year 1995 would look if you share with him that you have unlimited access to music through Spotify. For him it is crazy, for you it is normal. We are going to explore the possible disruptions of tomorrow by combing through the narratives we cannot imagine in the world of today. With new elements in technology, we can build it, but we do not yet fully understand it. Technology is not the main challenge. It is us, the humans, who miss out on tons of possibilities because of frozen mindsets. What can we learn from the 8.7 million other animal species, that fulfil their basic needs using ecosystems without ownership, without identity like humans use it, and without money?


Animated artwork by Rob√®rt Gu√©rain (www.guerain.nl)
